import Vue from "vue";
import Router from "vue-router";
Vue.use(Router);

import CleaningHours from "../components/CleaningHours.vue";
import CleaningHoursPT from "../components/CleaningHoursPT.vue"

export default new Router({
  routes: [
    {
      path: "/cleaning",
      alias: "/",
      name: "CleaningHours",
      component: CleaningHours,
    },
    {
        path: "/cleaning/pt",
        name: "CleaningHoursPT",
        component: CleaningHoursPT,
      },
  ],
});
